import { useEffect, useState } from "react";
import "./App.css";
import "./main.css";
import axios from "axios";

function App() {
  const [item, setItem] = useState([]);
  useEffect(() => {
    const fecthItem = async () => {
      const results = await axios("https://jsonplaceholder.typicode.com/posts");
      setItem(results.data);
    };

    fecthItem();
  }, []);

  return (
    <>
      <ul>
        {item.map((item) => (
          <li key={item.id}>
            <p>{item.title}</p>
          </li>
        ))}
      </ul>
    </>
  );
}
export function Title() {
  return <h1>MES AMIS ROBOT</h1>;
}
export function Input() {
  return <input placeholder="rechercher par nom " />;
}
